def findPattern(pattern, genome):
    find_list = []
    i = len(pattern)
    for x in range(len(genome) - i + 1):
        if genome[x : i + x] == pattern:
            find_list.append(x)
        else:
            pass
    return " ".join(list(map(str, find_list)))


pattern = "AGAGTATAG"
genome = ""

print(findPattern(pattern, genome))
